    function dataURItoBlob(dataURI) {
      var mimeString = dataURI.split(',')[0].split(':')[1].split(';')[0]; // mime类型
      var byteString = atob(dataURI.split(',')[1]); //base64 解码
      var arrayBuffer = new ArrayBuffer(byteString.length); //创建缓冲数组
      var intArray = new Uint8Array(arrayBuffer); //创建视图

      for (var i = 0; i < byteString.length; i++) {
        intArray[i] = byteString.charCodeAt(i);
      }
      return new Blob([intArray], {type: mimeString});
    }

    var videoBlob = dataURItoBlob(videoBase64);
    

    var screenDirection = window.matchMedia("(orientation: portrait)");
    var handleOrientationChange = function (screenDirection, isLoad) {
      var isPortrait = false;
      // 拿到屏幕宽和高
      var width = document.body.clientWidth;
      var height = document.body.clientHeight;
      if (typeof dapi !== 'undefined') {
        var size = dapi.getScreenSize();
        if (isLoad) {
          // iS平台接口的数据延后； 除第一次都反过来；
          width = size.width;
          height = size.height;
        } else {
          height = size.width;
          width = size.height;
        }
      }
      // 根据宽高判断是否为竖屏
      isPortrait = width < height ? true : false;
      if (isPortrait) {
        /* 竖屏处理事件 */
        video.style = "position: absolute; width: 100%; top: 50%; transform:translateY(-50%); -webkit-transform:translateY(-50%); left: 0;"
        // video.style = "transform:translateX(-48%);-webkit-transform:translateX(-48%);"
        // output.style = "transform:translateX(-48%);-webkit-transform:translateX(-48%);"
        // logo.style.left = "auto";
        // button.style.right = "auto";
      } else {
        video.style = "position: absolute; height: 100%; left: 50%; transform:translateX(-50%); -webkit-transform:translateX(-50%); top: 0;"
        // video.style = "transform:translateX(-50%);-webkit-transform:translateX(-50%);"
        // output.style = "transform:translateX(-50%);-webkit-transform:translateX(-50%);"
        // logo.style.left = "15px";
        // button.style.right = "25px";
      }
    }
    handleOrientationChange(undefined, false);
    window.onresize = handleOrientationChange(undefined, true);
    // screenDirection.addListener(handleOrientationChange);

    function playVideo () {
      video.muted = true;
      video.loop = false;
      video.currentTime = 0;
      video.play();
      video.addEventListener('playing', function() {
        video.muted = false;
        console.log('playing', video.muted);
        setTimeout(function () {
          // video.currentTime = 0;
          video.muted = false;
          video.play();
        }, 1000);
      });
      // 视频被暂停，有可能是播放错误，那就切换成图片；也有可能是用户切换了网页
      video.addEventListener('pause', function() {
        console.log('pause');
        if (document.hidden) {
          // 页面影藏了
        } else {
          // 播放失败 错误
          onVideoEnded();
        }
      });
    }

    function onVideoEnded() {
      window.isVideoEnded = true;
      window.video.remove();
      document.getElementById('video-wrap').remove();
      document.getElementById('hint').remove();
    }

    document.addEventListener('DOMContentLoaded', function () {
      document.getElementById('videoSrcBlob').src = URL.createObjectURL(videoBlob);
      document.getElementById('videoSrcBase64').src = videoBase64;
      // video.src = URL.createObjectURL(videoBlob);
      video.load();
      video.currentTime = 6.9; // 在部分浏览器会导致卡死
      // video.autoplay = true;
      handleOrientationChange(screenDirection, true);
      // 视频播放完就关掉它
      video.addEventListener('ended', onVideoEnded);
    });
    // 监听页面是否被切到后台
    document.addEventListener("visibilitychange", function () {
      if (document.hidden) {
        if (!window.isVideoEnded) video.pause();
      } else {
        if (!window.isVideoEnded) video.play();
      }
    });
    window.addEventListener('touchstart', function videoStart() {
      if (!window.isUserClicked) {
        window.isUserClicked = true;
        console.log('touch to play');
        setTimeout(function () {
          playVideo();
        }, 250);
        // output.remove();
        this.removeEventListener('touchstart', videoStart);
      }
    });
  </script>
